// Sidebar.js

import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div style={sidebarStyle}>
      <Link to="/profile" style={linkStyle}>
        Profile
      </Link>
      {/* <Link to="/bikes" style={linkStyle}>
        Bikes
      </Link>
      <Link to="/history" style={linkStyle}>
        History
      </Link>
      <Link to="/aboutus" style={linkStyle}>
        About Us
      </Link>
      <Link to="/logout" style={linkStyle}>
        Logout
      </Link> */}
    </div>
  );
};

const sidebarStyle = {
  height: '100%',
  width: '200px',
  position: 'fixed',
  top: '0',
  left: '0',
  backgroundColor: '#333',
  padding: '20px',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'flex-start',
};

const linkStyle = {
  color: '#fff',
  textDecoration: 'none',
  padding: '10px',
  marginBottom: '10px',
};

export default Sidebar;
